import React from 'react';

const Checkout = () => (
  <div>
    <h1>Your items</h1>
    <ul>
      <li>Cracking the coding interview</li>
      <li>Hands on Next</li>
      <li>You don't know JS</li>
    </ul>
  </div>
);

export default Checkout;
